2df07383-04ef-4a1a-b3e9-e78ba528792c.debug:
{
  "query": "
query FocusProjectCandidateSearch($searchString: String!, $first: Int!, $after:String) {
    rateLimit{
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    search(type:REPOSITORY, query:$searchString, first:$first, after:$after){
        pageInfo {
            startCursor
            hasNextPage
            endCursor
        }
        repositoryCount
        nodes{
            ...RepositorySummary
        }
    }
}
fragment RepositorySummary on Repository{
    nameWithOwner
    isInOrganization
    owner{
        login
    }
    forkCount
    stargazerCount
    pullRequests{
        totalCount
    }
    issues{
        totalCount
    }
    mentionableUsers{
        totalCount
    }
    watchers{
        totalCount
    }
    discussions{
        totalCount
    }    
    createdAt
    isPrivate
    pushedAt
    visibility
    primaryLanguage{
        name
    }
    languages(first:100){
        edges{
            size
            node{
              name
            }
        }
    }
}
",
  "variables": {
    "searchString": "is:public template:false archived:false stars:>=50 forks:>=50 size:>=1000 pushed:>=2024-03-21 created:2017-09-25..2017-09-29",
    "first": 100,
    "after": null
  }
}

